def transform(sequence):
    list_seq = list(sequence)
    zeros = [i for i in list_seq if i == '0']
    others = [i for i in list_seq if i != '0']
    return ''.join(zeros + others)

def transform(sequence):
    sequence = list(sequence)
    sequence.sort()
    return "".join(sequence)

def transform(sequence):
    zero_count = sequence.count('0')
    non_zero_part = [char for char in sequence if char != '0']
    return '0' * zero_count + ''.join(non_zero_part)

def transform(sequence):
  seq_list = list(sequence)
  sorted_seq = sorted(seq_list)
  return "".join(sorted_seq)
